import Logo from "../../images/manuel'slogo.png";

const Nav = () => {
	return (
		<nav>
			<div>
				<img
					src={Logo}
					alt=""
				/>
			</div>
			<div>
				<div>Works</div>
				<div>About</div>
				<div>Contacts</div>
			</div>
		</nav>
	);
};

export default Nav;
